import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="header">
    <h2 className="App">
     Monster game
    </h2>

    <form >
      <input placeholder="enter username" />
      <button>Begin</button>
    </form>
    <h1>Level 1</h1>
    <h3>Question 1</h3>
    <form>
      What variable cannot be reassigned in javaScript?
      <input></input>
    </form>
    </div>

  );
}

export default App;
